import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // Check if cart is empty
    const emptyCart = await page.$('.empty-cart');
    if (emptyCart) {
      throw new Error('Cart is empty - cannot update quantity');
    }

    // Get initial quantity
    const initialQuantity = await page.$eval('.cart-item .quantity', el => el.textContent);

    // Increase quantity by clicking the plus button
    await page.waitForSelector('.cart-item .quantity-btn:last-of-type', { timeout: 5000 });
    await page.click('.cart-item .quantity-btn:last-of-type');

    // Wait for quantity to update
    await page.waitForFunction(
      (initialQty) => {
        const currentQty = document.querySelector('.cart-item .quantity').textContent;
        return currentQty !== initialQty;
      },
      { timeout: 5000 },
      initialQuantity
    );

    // Get updated quantity
    const updatedQuantity = await page.$eval('.cart-item .quantity', el => el.textContent);

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_updated_quantity.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_updated_quantity.png'));

    return {
      success: true,
      action: "Updated cart item quantity from " + initialQuantity + " to " + updatedQuantity,
      extractedData: {
        initialQuantity,
        updatedQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
